import { Outlet, Link, useLocation } from 'react-router-dom'
import Header from './Header/Header'

const Layout = () => {
    return (
        <div className='Layout'>
            <Header/>
            <main className='containerMain'>
                <Outlet />
            </main>
        </div>
    )
}

export default Layout
